import React from 'react';
import "./NotfoundPage.css"
import { CookieLibrary } from '../../Library';

class ProfilePage extends React.Component
{
    componentDidMount()
    {
        const cLib = new CookieLibrary();
        const userId = cLib.GetCookieUserId();
        if(userId == null) 
        {
            alert("먼저 로그인이 필요합니다.")
            window.location.replace(`${window.location.origin}/signin`)
            
        }


    }







    render(){
    
        return (<div className='NotfoundPage'>
            <div onClick={()=>{window.location.replace(`${window.location.origin}/`)}}>
                <i className="Announce">Page NotFounded!</i>
                <br/>
                <i className="ReturnLink"
                    >Please click here to go back to home!</i>
            </div>
        </div>)
    }
}

export default ProfilePage
